        "description": "\"A traditional Bordeaux eatery just moments from the banks of the Garonne River, the Bistrot des Anges offers a welcoming atmosphere, friendly service and pleasant surroundings - the ideal foil to a mouthwatering menu of classic French dishes. Intimate and cosy, the interior has the feel of a family dining room with tables close together and a buzz of conversation on the air. But when the sun comes out there's competition for seats on the sun trap terrace, a lovely escape from the city streets where the food seems to taste even sweeter. The extensive menu offers something for everyone with a strong lean towards flavours from the South West of France. \"",
